import React from "react";
import './formSelector.css';

function FormSelector({ label, options, ...otherProps }) {
  return (
    <div>
      <label>{label}</label>
      <div>
        <select {...otherProps} className="custom-select" >
          {options.map((option) => (
            <option key={option.value} value={option.value}>
              {option.label}
            </option>
          ))}
        </select>
      </div>
    </div>
  );
}
export default FormSelector;
